import api from '../../../Re-usable/Api Url/apiURL'

export const postPatientToQueue =async (queue, history) =>  {

    try {
        await api.post(webApiURL.waitingQueue.postPatientToWaitingQueue, queue)
        history.push(routeURLs.waitingQueue)
    } catch (e) {

    }
}
